(65, 'Blog PHP', '<h4>"Neque porro quisquam est qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit..."</h4>\r\n<h5>"No hay nadie que ame el dolor mismo, que lo busque, lo encuentre y lo quiera, simplemente porque es el dolor."</h5>\r\n<div>\r\n<div class="lc">\r\n<h2 class="what">&nbsp;</h2>\r\n<p><strong>Lorem Ipsum</strong>&nbsp;es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno est&aacute;ndar de las industrias desde el a&ntilde;o 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido us&oacute; una galer&iacute;a de textos y los mezcl&oacute; de tal manera que logr&oacute; hacer un libro de textos especimen. No s&oacute;lo sobrevivi&oacute; 500 a&ntilde;os, sino que tambien ingres&oacute; como texto de relleno en documentos electr&oacute;nicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creaci&oacute;n de las hojas "Letraset", las cuales contenian pasajes de Lorem Ipsum, y m&aacute;s recientemente con software de autoedici&oacute;n, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.</p>\r\n</div>\r\n<div class="rc">\r\n<h2 class="why">&nbsp;</h2>\r\n<p>Es un hecho establecido hace demasiado tiempo que un lector se distraer&aacute; con el contenido del texto de un sitio mientras que mira su dise&ntilde;o. El punto de usar Lorem Ipsum es que tiene una distribuci&oacute;n m&aacute;s o menos normal de las letras, al contrario de usar textos como por ejemplo "Contenido aqu&iacute;, contenido aqu&iacute;". Estos textos hacen parecerlo un espa&ntilde;ol que se puede leer. Muchos paquetes de autoedici&oacute;n y editores de p&aacute;ginas web usan el Lorem Ipsum como su texto por defecto, y al hacer una b&uacute;squeda de "Lorem Ipsum" va a dar por resultado muchos sitios web que usan este texto si se encuentran en estado de desarrollo. Muchas versiones han evolucionado a trav&eacute;s de los a&ntilde;os, algunas veces por accidente, otras veces a prop&oacute;sito (por ejemplo insert&aacute;ndole humor y cosas por el estilo).</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div>\r\n<div class="lc">\r\n<h2 class="where"><img src="http://www.molletvalles.cat/files/28-5167-imatge/estrategia25_logo_ban.gif" alt="" width="594" height="278" />&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<p>Al contrario del pensamiento popular, el texto de Lorem Ipsum no es simplemente texto aleatorio. Tiene sus raices en una pieza cl&acute;sica de la literatura del Latin, que data del a&ntilde;o 45 antes de Cristo, haciendo que este adquiera mas de 2000 a&ntilde;os de antiguedad. Richard McClintock, un profesor de Latin de la Universidad de Hampden-Sydney en Virginia, encontr&oacute; una de las palabras m&aacute;s oscuras de la lengua del lat&iacute;n, "consecteur", en un pasaje de Lorem Ipsum, y al seguir leyendo distintos textos del lat&iacute;n, descubri&oacute; la fuente indudable. Lorem Ipsum viene de las secciones 1.10.32 y 1.10.33 de "de Finnibus Bonorum et Malorum" (Los Extremos del Bien y El Mal) por Cicero, escrito en el a&ntilde;o 45 antes de Cristo. Este libro es un tratado de teor&iacute;a de &eacute;ticas, muy popular durante el Renacimiento. La primera linea del Lorem Ipsum, "Lorem ipsum dolor sit amet..", viene de una linea en la secci&oacute;n 1.10.32</p>\r\n<p>El trozo de texto est&aacute;ndar de Lorem Ipsum usado desde el a&ntilde;o 1500 es reproducido debajo para aquellos interesados. Las secciones 1.10.32 y 1.10.33 de "de Finibus Bonorum et Malorum" por Cicero son tambi&eacute;n reproducidas en su forma original exacta, acompa&ntilde;adas por versiones en Ingl&eacute;s de la traducci&oacute;n realizada en 1914 por H. Rackham.</p>\r\n</div>\r\n<div class="rc">\r\n<h2 class="getsome">&nbsp;</h2>\r\n<p>Hay muchas variaciones de los pasajes de Lorem Ipsum disponibles, pero la mayor&iacute;a sufri&oacute; alteraciones en alguna manera, ya sea porque se le agreg&oacute; humor, o palabras aleatorias que no parecen ni un poco cre&iacute;bles. Si vas a utilizar un pasaje de Lorem Ipsum, necesit&aacute;s estar seguro de que no hay nada avergonzante escondido en el medio del texto. Todos los generadores de Lorem Ipsum que se encuentran en Internet tienden a repetir trozos predefinidos cuando sea necesario, haciendo a este el &uacute;nico generador verdadero (v&aacute;lido) en la Internet. Usa un diccionario de mas de 200 palabras provenientes del lat&iacute;n, combinadas con estructuras muy &uacute;tiles de sentencias, para generar texto de Lorem Ipsum que parezca razonable. Este Lorem Ipsum generado siempre estar&aacute; libre de repeticiones, humor agregado o palabras no caracter&iacute;sticas del lenguaje, etc.</p>\r\n</div>\r\n</div>', '2015-02-28', , 1);
INSERT INTO `News` (`id`, `title`, `content`, `date`, `image`, `id_Author`) VALUES
(68, 'Kebab XD', '<p>&nbsp;</p>\r\n<p>Dzisiejsza lekcja bdzie powicona trudnej sztuce konsumowania Kebabu, kt&oacute;ra &ndash; cho dzi wydaje si by jedynie fantazyjn wizj lepszego wiata &ndash; w XVIII wieku z powodzeniem bya praktykowana w Iranie. Pamitajcie, e by pokona przeciwnika, trzeba go najpierw dokadnie pozna. Oto sam suczysyn:</p>\r\n<p><em>W Polsce sowo kebab oznacza zazwyczaj d&ouml;ner kebap (po turecku &lsquo;obracajce si pieczone miso&rsquo;), czyli danie kuchni tureckiej w postaci baraniny (moe by to r&oacute;wnie miso cielce lub drobiowe, nigdy wieprzowe) skrawanej z pionowego rona z sur&oacute;wk i owczym serem oraz przanym chlebem, wsp&oacute;czenie przeksztacone w danie typu fast food, podawane w przanym chlebie, picie lub buce z sur&oacute;wk warzywn oraz r&oacute;nymi sosami &ndash; agodnymi lub ostrymi.</em></p>\r\n<p>Jak widzicie nie ma art&oacute;w, ale Wasi eksperci z <strong>Jaky</strong> zapewniaj &ndash; jeszcze dzi nabdziecie podstawy do poprawnej konsumpcji kebabu. I to za darmo! W tym celu kebab trzeba podzieli zasadniczo na dwie elementarne&nbsp; grupy:</p>\r\n<p>&ndash; na grubym ciecie (adresowany do grubas&oacute;w, kt&oacute;rzy lubi nawpycha si buy)</p>\r\n<p>&ndash; na cienkim ciecie (dla seksualnych abstynent&oacute;w, kt&oacute;rzy lubi potrzyma pieroka)</p>\r\n<p>Technika walki z kadym z nich jest nieco inna, zawsze jednak tak samo skomplikowana. G&oacute;wn si raenia kebabu stanowi ciekncy sos i wysypujca si sur&oacute;wka. W wielu przypadkach nasi czytelnicy zgaszali si do nas r&oacute;wnie z problemem potuczonego szka w pokarmie, arabskiego gila, popiou z papierosa, podartych kawak&oacute;w Tygodnika Powszechnego i psiego misa (to niestety w cale nie jest adna urban legend tylko najszczersza, prawdziwa prawda).</p>\r\n<p>Mionicy kebabu na grubym ciecie wielokrotnie spotykaj si z problemem wysypujcej si bokami zawartoci kebabu. Jest to szczeg&oacute;lnie niebezpieczne, gdy jestemy bardzo godni, bowiem spora cz zawartoci lduje na chodniku (cho warto tu doceni rosnce dziki kebabom walory architektoniczno-krajobrazowe polskich miast). W wypadku kebabu na grubym ciecie czsto mona spotka te wysublimowanych ludzi elity, kt&oacute;rzy kupujc kebab za 7 zotych pragn udowodni swoj wyszo, a take potwierdzi finansow niezaleno, jedzc posiek widelczykiem. <strong>Bd!</strong></p>\r\n<figure class="wp-caption aligncenter" style="text-align: center;"><img style="display: block; margin-left: auto; margin-right: auto;" title="kebab" src="http://foto.chudkiewicz.com/img/foto/kebab.jpg" alt="Sprzedawcy Kebabu to rzeczywici ambasadorowie Turcji na terenie RP" width="453" height="338" /><figcaption class="wp-caption-text">Sprzedawcy Kebabu to rzeczywici ambasadorowie Turcji na terytorium RP</figcaption></figure>\r\n<p>Walka z kebabem na grubym ciecie to wbrew pozorom r&oacute;wna walka, w kt&oacute;rej masz due szanse. Musicie jedynie pamita o wanej kwestii &ndash; zachowaniu r&oacute;wnowagi w trakcie konsumcji. Przechylenie rki w jedn lub drug stron zaowocuje wypieprzeniem zawartoci kebabu. Nie warto te atakowa go od g&oacute;ry, gdy w&oacute;wczas zawarto wylduje na kurtce atakujcego, za on sam upieprzy swoje usta sosem, co w przypadku sosu czosnkowego moe budzi dodatkowe bodce u napotkanych przechodni&oacute;w, dla kt&oacute;rych RedTube jest wyznacznikiem g&oacute;wnych wzorc&oacute;w relacji spoecznych.&nbsp; Lata trening&oacute;w, lata praktyki oraz spory zas&oacute;b wrodzonych umiejtnoci nauczyy nas, i najlepsz metod konsumpcji kebabu na grubym ciecie jest telekineza. Za pomoc siy umysu przenosimy zawarto buki do naszych ust. Wane &ndash; nawet w trakcie procesu lewitowania sur&oacute;wki do naszej buzi naley pamita o sosie, kt&oacute;ry jako ciecz niechtnie poddaje si temu procesowi.</p>\r\n<p>Duo atwiej sprawa ma si z &bdquo;pierokiem&rdquo;, czyli kebabem na cienkim ciecie. Na pierwszy rzut oka w takim wypadku otrzymujemy sp&oacute;jn, zawinit koncepcj, dziki czemu upieprzenie si na &bdquo;gwiazd RedTube&rsquo;a&rdquo; bdzie niemoliwe.<strong> Nic bardziej mylnego!</strong> Jak wszyscy bowiem wiemy pieroek ma wyjtkow zdolno do atakowania &bdquo;od dou&rdquo; i cho moecie by zadowoleni z postp&oacute;w na g&oacute;rze, z dou ten bezlitosny kawaek ciasta atakuje was swoimi najbardziej biaymi sokami.</p>\r\n<p>Ale i w tej sytuacji zaoga <strong>Jaky</strong> przychodzi Wam z pomoc! Przede wszystkim trzeba podj stosowne rodki zabezpieczajce. D&oacute; kebabu najlepiej oboy przynajmniej picioma chusteczkami higienicznymi, mile widziany jest take papier toaletowy oraz jaka wyjtkowo dua i szczelna prezerwatywa (jeli naoycie j na kebab bez problem&oacute;w, to znaczy, e kebab jest za may i nie spenia norm europejskich, a ponadto moe mie kompleksy i problemy na tle osobistym &ndash; badania przeprowadzone przez <strong>Jaky</strong> na zlecenie ABDULLAHKEBABULLAH Sp. z o.o.). Czasem jednak i takie zabezpieczenie moe nie wystarczy, dlatego pamitaj &ndash; w kadej moliwej okazji &ndash; kebab na cienkim jest odbezpieczonym granatem w Twojej rce, trzymaj go z dala od wasnego ciaa. Nawet mimo tak szczeg&oacute;owo podjtych krok&oacute;w istnieje ryzyko upieprzenia si kebabem, jednake w przypadku cienkiego ciasta metoda lewitowania poszczeg&oacute;lnych skadnik&oacute;w nie sprawdza si w najlepszym stopniu.</p>\r\n<figure class="wp-caption aligncenter" style="text-align: center;"><img style="display: block; margin-left: auto; margin-right: auto;" title="Kebab" src="http://arbiter.pl/files/g/2_5612_243_4304.jpg" alt="Kebab Amira to zaprzyjaniony z Jaky lokal, w zwizku z czym pozwolilimy sobie na reklam. Znajdziecie go na ulicy Marszakowskiej przy tych 30 sexshopach (wyposzczeni mionicy kebabu na cienkim bd wiedzieli gdzie to)" width="424" height="317" /><figcaption class="wp-caption-text">Kebab Amira to zaprzyjaniony z Jaky lokal, w zwizku z czym pozwolilimy sobie na reklam. Znajdziecie go na ulicy Marszakowskiej przy tych 30 sexshopach (wyposzczeni mionicy kebabu na cienkim bd wiedzieli gdzie to)</figcaption></figure>\r\n<p>Trzeba przypomnie, i 28.10.2008 roku w Warszawie odbya si wielka bitwa kebabowa, gdzie setki nagich studentek i student&oacute;w wzio udzia w dorocznym festynie obrzucania si kebabem. W trakcie takiej uroczystoci podstawowe normy i dogmaty konsumowania kebab nie obowizuj, paradoksalnie jednak wedle statystyk uczestnicy upieprzyli si mniej ni podczas tradycyjnej pr&oacute;by skonsumowania posiku. Kebab jest niewtpliwie chytrym i dobrze wyszkolonym przeciwnikiem. Pamitajcie, e tylko dziki naszym poradom macie jakie faktyczne szanse w tej walce.</p>\r\n<p><strong>Katecheza #3:</strong> Nie masz si co napina, bo i tak nie przechytrzysz kebabu. Bd kr&oacute;lem ycia i jedz pizz albo chod brudny.</p>', '2015-02-28', , 1);

